export default function Slider() {
	return (
		<>
			<div className="wrapper">
				<div className='header'>

				</div>
				<ul id="slider">
					<li className="slide"><img src={`${process.env.PUBLIC_URL}/assets/img/slider/slider-1.png`} width="100%" height="400px" /></li>
					<li className="slide"><img src={`${process.env.PUBLIC_URL}/assets/img/slider/slider-2.png`} width="100%" height="400px" /></li>
					<li className="slide"><img src={`${process.env.PUBLIC_URL}/assets/img/slider/slider-3.png`} width="100%" height="400px" /></li>
				</ul>
			</div>

		</>
	);
}
